import { useState, useEffect } from "react";
interface ItemProps {
  name: string;
  price: string;
}
const Item = ({ name, price: string }) => (
  <>
    <span>{name}</span>
    <span>{price}</span>
  </>
);

export const Cart = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    setItems([
      { id: 1, name: "Espresso", price: "5.00€" },
      { id: 2, name: "Espresso", price: "5.00€" },
      { id: 3, name: "Orange Juice", price: "7.50€" },
      { id: 4, name: "Club Sandwich", price: "12.00€" },
      { id: 5, name: "Club Soda", price: "2.75€" },
    ]);
  }, []);

  return (
    <div>
      {items.map((item) => (
        <Item key={item.id} name={item.name} price={item.price} />
      ))}
    </div>
  );
};
